#include "nios2_ctrl_reg_macros.h"

struct audio_t {
  volatile unsigned int control;
  volatile unsigned char rarc;
  volatile unsigned char ralc;
  volatile unsigned char wsrc;
  volatile unsigned char wslc;
  volatile unsigned int ldata;
  volatile unsigned int rdata;
};



volatile int songIndex;
const int output_length = 229651;
struct audio_t *const audiop = ((struct audio_t *)0xff203040);

void audio_ISR(){
    //printf("interupt!\n");
    //printf("%d ",audiop->control);
	//printf("%d\n", 0b1000000000);
	
    while((audiop->control & 0b1000000000)!=0){
        audiop->ldata = audioOutput[songIndex];
        //printf("outsong");
        audiop->rdata = audioOutput[songIndex];
        songIndex++;
        if(songIndex>=output_length){
            songIndex =0;
        }
    }

}

void interrupt_handler(void) { 
    //printf("got to interupt handler");
    int ipending;
    NIOS2_READ_IPENDING(ipending);
    // if (ipending & 0x1) // interval timer is interrupt level 0 
    // {
    //     interval_timer_ISR();
    // }
    // if (ipending & 0x2) // pushbuttons are interrupt level 1 
    // {
    //     pushbutton_ISR();
    // }
    if (ipending & 0x40){
        audio_ISR();
    }
        // else, ignore the interrupt
    return; 
}
void the_exception(void)
/*******************************************************************************
 * Exceptions code. By giving the code a section attribute with the name
 * ".exceptions" we allow the linker program to locate this code at the proper
 * exceptions vector address.
 * This code calls the interrupt handler and later returns from the exception.
 ******************************************************************************/
{
  asm("subi sp, sp, 128");
  asm("stw et, 96(sp)");
  asm("rdctl et, ctl4");
  asm("beq et, r0, SKIP_EA_DEC");  // Interrupt is not external
  asm("subi ea, ea, 4");           /* Must decrement ea by one instruction
                                    * for external interupts, so that the
                                    * interrupted instruction will be run */
  asm("SKIP_EA_DEC:");
  asm("stw r1, 4(sp)");  // Save all registers asm("stw r2, 8(sp)");
  asm("stw r2, 8(sp)");
  asm("stw r3, 12(sp)");
  asm("stw r4,  16(sp)");
  asm("stw r5,  20(sp)");
  asm("stw r6,  24(sp)");
  asm("stw r7,  28(sp)");
  asm("stw r8,  32(sp)");
  asm("stw r9,  36(sp)");
  asm("stw r10, 40(sp)");
  asm("stw r11, 44(sp)");
  asm("stw r12, 48(sp)");
  asm("stw r13, 52(sp)");
  asm("stw r14, 56(sp)");
  asm("stw r15, 60(sp)");
  asm("stw r16, 64(sp)");
  asm("stw r17, 68(sp)");
  asm("stw r18, 72(sp)");
  asm("stw r19, 76(sp)");
  asm("stw r20, 80(sp)");
  asm("stw r21, 84(sp)");
  asm("stw r22, 88(sp)");
  asm("stw r23, 92(sp)");
  asm("stw r25, 100(sp)");
  asm("stw r26, 104(sp)");  // r25=bt
  asm("stw r26, 104(sp)");
  // skip r27 because it is sp, and there is no point in saving this
  asm("stw r28, 112(sp)");
  asm("stw r29, 116(sp)");
  asm("stw r30, 120(sp)");
  asm("stw r31, 124(sp)");
  asm("addi   fp,  sp, 128");
  asm("call interrupt_handler");  // Call the C language interrupt handler
  asm("ldw r1, 4(sp)");           // Restore all registers r2, 8(sp)
  asm("ldw r3, 12(sp) ");
  asm("ldw r4, 16(sp) ");
  asm("ldw r5,  20(sp)");
  asm("ldw  r6,  24(sp)");
  asm("ldw  r7,  28(sp)");
  asm("ldw  r8,  32(sp)");
  asm("ldw  r9,  36(sp)");
  asm("ldw  r10, 40(sp)");
  asm("ldw  r11, 44(sp)");
  asm("ldw  r12, 48(sp)");
  asm("ldw  r13, 52(sp)");
  asm("ldw  r14, 56(sp)");
  asm("ldw  r15, 60(sp)");
  asm("ldw  r16, 64(sp)");
  asm("ldw  r17, 68(sp)");
  asm("ldw  r18, 72(sp)");
  asm("ldw  r19, 76(sp)");
  asm("ldw  r20, 80(sp)");
  asm("ldw  r21, 84(sp)");
  asm("ldw  r22, 88(sp)");
  asm("ldw  r23, 92(sp)");
  asm("ldw  r24, 96(sp)");
  asm("ldw  r25, 100(sp)");
  asm("ldw  r26, 104(sp)");
  asm("ldw  r28, 112(sp)");
  asm("ldw  r29, 116(sp)");
  asm("ldw  r30, 120(sp)");
  asm("ldw  r31, 124(sp)");
  asm("addi   sp,  sp, 128");
  asm("eret");
}
void the_reset(void)
/*******************************************************************************
 * Reset code. By giving the code a section attribute with the name ".reset" we
 * allow the linker program to locate this code at the proper reset vector
 * address. This code just calls the main program.
 ******************************************************************************/
{
  asm(".set noat");       /* Instruct the assembler NOT to use reg at
                         (r1) as * a temp register for performing optimizations */
  asm(".set nobreak");    /* Suppresses a warning message that says that *
                         some debuggers corrupt regs bt (r25) and ba
                         * (r30)
                         */
  asm("movia r2, main");  // Call the C language main program
  asm("jmp r2");
}


